import React from 'react'
import { TextField } from '@material-ui/core'

function StoryField() {
    return (
        <div style={{ textAlign: "center", marginTop: "1rem", height: "100vh" }}>
            <TextField multiline variant="outlined" style={{ width: "50%" }} rows="10"></TextField>

        </div>
    )
}

export default StoryField
